import React from 'react';

const Pagination = ({gotoNextPage, gotoPrevPage}) => {
    return(
        <div className="pagination">
            {gotoPrevPage && <button onClick={gotoPrevPage}>
                Previous Page
            </button>}
            {gotoNextPage && <button onClick={gotoNextPage}>
                Next Page
            </button>}
        </div>
    )
}

export default Pagination;
